/// Since: 2.74
/// @G_SPAWN_CHILD_INHERITS_STDERR: the child will inherit the parent's standard error.
/// Since: 2.74
/// @G_SPAWN_STDIN_FROM_DEV_NULL: the child's standard input is attached to `/dev/null`.
